<script>
  import drinks from './drinks.json';
  import estados from "./estados.json";
  import Modal from './Modal.svelte';

  let BRCONFIG = $state({});

  let showModal = $state(false);

  let drinkName = $state("");
  let drinkIngredients = $state("");
  let drinkPreparation = $state("");
  let drinkDescription = $state("");

  let activeState = $state("");

  for(let i = 0; i < Object.keys(estados).length; i++){
    const key = Object.keys(estados)[i];
    console.log(key);
    BRCONFIG[key] = {
      "over": () => { BRCONFIG["color_" + key] = "DarkBlue"; console.log("ActiveState: " + activeState)},
      "out": () => { BRCONFIG["color_" + key] = "#0000CC"; console.log("Bolas2")},
      "click": () => {
          showModal = true;
          activeState = key;
          drinkName = drinks[key.toUpperCase()]["drink"];
          drinkIngredients = drinks[key.toUpperCase()]["ingredientes"];
          drinkPreparation = drinks[key.toUpperCase()]["preparo"];
          drinkDescription = drinks[key.toUpperCase()]["descricao"];
      },
    };
    BRCONFIG["color_" + key] = "#0000CC";
  }

  $effect(() => {
    if(!showModal){
      activeState = "";
    }
  })
</script>

