          </div>
        </div>
      </div>

    </div>
  {/snippet}

  <div class="drink-viewer__body">
    <aside class="left-pane">
      <h3 class="panel-title">Ingredientes</h3>
      <ul class="ingredient-list">
        {#if Array.isArray(drinkIngredients)}
          {#each drinkIngredients as item}
            <li>{item}</li>
          {/each}
        {:else}
          <li>{drinkIngredients}</li>
        {/if}
      </ul>
    </aside>

    <main class="right-pane">
