<style>
    svg * {
      transform-box: fill-box;
      transition: transform 320ms cubic-bezier(.2,.9,.2,1), filter 320ms, opacity 220ms;
    }

    /* estado zoomed: aumenta, aplica sombra e fica acima visualmente */
    .zoom {
      transform: scale(1.9);
      filter: drop-shadow(0 18px 28px rgba(0,0,0,0.35));
      /* assegura que o elemento pare√ßa acima do resto */
      isolation: isolate;
    }

    /* dimina os demais elementos quando um estiver ativo */
    .dim {
      opacity: 0.22;
      pointer-events: none; /* evita intera√ß√£o nos demais enquanto um est√° zoomed */
    }

    /* suaviza pequena transi√ß√£o para retornar ao normal */
    svg *:not(.zoom) {
      transition: opacity 220ms, transform 320ms;
    }

    /* responsividade: em telas pequenas reduz a intensidade do zoom */
    @media (max-width: 640px) {
      .zoom {
        transform: scale(1.4);
      }
    }

    .drink-viewer__header {
      display: flex;
      justify-content: space-between;
      align-items: flex-start;
      gap: 1rem;
      padding-bottom: 0.6rem;
    }

    /* Hero: circular badge left + title */
    .drink-hero {
      display: flex;
      gap: 0.9rem;
      align-items: center;
    }

    .hero-image {
      width: 72px;
      height: 72px;
      min-width: 72px;
      border-radius: 16px;
      display: grid;
      place-items: center;
      background: linear-gradient(180deg, rgba(30,111,184,0.14), rgba(6,14,24,0.08));
      border: 1px solid rgba(30,111,184,0.12);
      box-shadow: 0 10px 24px rgba(8,18,34,0.45);
      color: #eaf6ff;
      font-size: 28px;
    }

    /* fallback emoji inside hero */
    .hero-emoji { font-size: 28px; }

    /* Title & meta */
    .drink-meta .drink-title {
      margin: 0;
      font-size: 1.05rem;
      font-weight: 700;
      color: #eaf6ff;
      letter-spacing: -0.2px;
    }

    .drink-sub {
      margin-top: 0.16rem;
      display: flex;
      align-items: center;
      gap: 0.5rem;
      color: #9fb0c8;
      font-size: 0.9rem;
    }

    .state-name { color: #cfe6ff; font-weight: 600; }
    .dot { opacity: 0.45; }

    /* Header action icons */
    .header-actions { display: flex; gap: 0.4rem; align-items: center; }
    .header-actions .icon {
      background: transparent;
      border: none;
      padding: 0.45rem;
      border-radius: 8px;
      cursor: pointer;
      color: #9fb0c8;
    }
    .header-actions .icon:hover { color: #eaf6ff; background: rgba(255,255,255,0.02); }

    /* Body layout: two columns */
    .drink-viewer__body {
      display: grid;
      grid-template-columns: 1fr 1.25fr;
      gap: 1rem;
      padding-top: 0.6rem;
    }

    /* Left pane - ingredients */
    .left-pane {
      background: linear-gradient(180deg, rgba(255,255,255,0.01), transparent);
      padding: 0.9rem;
      border-radius: 12px;
      border: 1px solid rgba(255,255,255,0.03);
      min-height: 160px;
    }
    .panel-title { margin: 0 0 0.6rem 0; color: #dff2ff; font-size: 0.95rem; }
    .ingredient-list {
      margin: 0;
      padding-left: 1rem;
      color: #dfeeff;
      list-style: disc inside;
    }
    .ingredient-list li { margin-bottom: 0.45rem; line-height: 1.45; font-size: 0.97rem; }

    /* Right pane - preparo + descricao */
    .right-pane { display: flex; flex-direction: column; gap: 0.75rem; }

    .preparation {
      padding: 0.9rem;
      border-radius: 10px;
      background: rgba(255,255,255,0.01);
      border: 1px solid rgba(255,255,255,0.03);
      color: #e6f3ff;
      line-height: 1.5;
      min-height: 120px;
    }

    .small { margin-top: 0.25rem; font-size: 0.86rem; color: #9fb0c8; }
    .desc { color: #9fb0c8; margin: 0; line-height: 1.45; }

    /* actions row at bottom of right pane */
    .actions-row {
      display: flex;
      gap: 0.6rem;
      justify-content: flex-end;
      margin-top: 6px;
    }
    .btn {
      padding: 0.5rem 0.9rem;
      border-radius: 10px;
      font-weight: 700;
      cursor: pointer;
      border: 1px solid rgba(255,255,255,0.04);
      background: transparent;
      color: #dff2ff;
    }
    .btn.primary {
      background: linear-gradient(90deg, rgba(30,111,184,0.14), rgba(30,111,184,0.06));
      border-color: rgba(30,111,184,0.12);
      color: #e9f7ff;
    }
    .btn.ghost { color: #9fb0c8; }
    .btn.outline {
      border-style: dashed;
      color: #9fb0c8;
      border-color: rgba(255,255,255,0.03);
    }

    /* small screens: stack */
    @media (max-width: 820px) {
      .drink-viewer__body { grid-template-columns: 1fr; }
      .hero-image { width: 60px; height: 60px; min-width: 60px; border-radius: 12px; }
      .actions-row { flex-direction: column-reverse; }
      .actions-row .btn { width: 100%; }
    }
</style>
